import React from "react";
import ChemistUpload from "./pages/ChemistUpload";
import DoctorCreatePrescription from "./pages/DoctorCreatePrescription";
import ChemistScan from "./pages/ChemistScan";

function App(){
  return (
    <div>
      <h1>LifeTag Dashboard</h1>
      <div style={{display:'flex', gap:20}}>
        <div style={{flex:1, borderRight:'1px solid #ddd'}}>
          <ChemistUpload />
        </div>
        <div style={{flex:1, borderRight:'1px solid #ddd'}}>
          <DoctorCreatePrescription />
        </div>
        <div style={{flex:1}}>
          <ChemistScan />
        </div>
      </div>
    </div>
  );
}
export default App;
